import React from 'react';
import 
{ LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} 
from 'recharts';
import 
{Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,} 
from 'recharts';
import {
  BarChart
} from 'recharts';
import data_Courbes from './Story_Book_Data_Courbes'
import data_Arraignée from './StoryBookArraignéeData'
import data_Histo from './StoryBookHistoData'
 import {
  ComposedChart, Bar
 } from 'recharts';
import data_Sticks from './StoryBook_Data_Sticks'
export default {
  title: 'Widgets',
};
export const Histo = () => (
            <BarChart
        width={500}
        height={300}
        data={data_Histo}
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="Visites_médicale" fill="#8884d8" />
      </BarChart>
    );
export const Nbre_de_pas = () => (
            <div className="Nbres_de_pas">
              <h1>Nombres de Pas</h1>
              <div className="Pas-today">
                <h5>6000</h5>
              </div>
              <div className="Pas-hier">
                <h6>Hier : 4000</h6>
              </div>
            </div>
);
export const widget3 = () => (
                <div className="Widget-3">
            <h3>Widget 3 : Total Views...</h3>
            </div>
);
export const Sticks_Vertical = () => (
<ComposedChart
        layout="vertical"
        width={500}
        height={315}
        data={data_Sticks}
        margin={{
          top: 20, right: 20, bottom: 20, left: 20,
        }}
      >
        <CartesianGrid stroke="#f5f5f5" />
        <XAxis type="number" />
        <YAxis dataKey="name" type="category" />
        <Tooltip />
        <Legend />
        <Bar dataKey="Temps_d'écran" barSize={20} fill="#413ea0" />
</ComposedChart>
);
export const Courbes = () => (
  <LineChart
                width={650}
                height={350}
                data={data_Courbes}
                margin={{ top: 5, right: 30, left: 1, bottom: 5,}}>
                <CartesianGrid strokeDasharray="2 2" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="Semaine_Précedente" stroke="#8884d8" activeDot={{ r: 8 }} />
                <Line type="monotone" dataKey="Semaine_Actuelle" stroke="#82ca9d" />
</LineChart>
);
export const Arraignée = () => (
<div className="widget_Arraignée">
        <div className="title">Activité physique en nombre d'heure</div>
            <RadarChart cx={250} 
                        cy={190} 
                        outerRadius={150} 
                        width={500} 
                        height={390} 
                        data={data_Arraignée}
                        >
              <PolarGrid />
              <PolarAngleAxis dataKey="subject" />
              <PolarRadiusAxis />
              <Radar name="Mike" dataKey="A" stroke="#111111" fill="#8884d8" fillOpacity={0.7} />
            </RadarChart>
</div>
);
